INSERT INTO public.dcim_devicetype VALUES (2, 'Nexus 93180YC-EX', 'n9k-c93180yc-ex', 1, true, 4, '', 'N9K-C93180YC-EX', 'The Cisco Nexus 93180YC-EX-24 Switch is a 1RU switch with latency of less than 1 microsecond. The 24 downlink ports (licensed to use any 24 ports out of the 48 ports) on the 93180YC-EX-24 can be configured to work as 1-, 10-, or 25-Gbps ports, offering deployment flexibility and investment protection. The 6 uplink ports can support 40- and 100-Gbps or a combination of 1-, 10-, 25-, 40-, 50, and 100-Gbps connectivity, thus offering flexible migration options. The switch has FC-FEC enabled for 25Gbps and supports up to 3m in DAC connectivity.', '2020-06-26', '2020-06-26 14:40:11.132204+09:30', 'devicetype-images/N9K-C93180YC-FX.jpg', '');
